    margin: '2rem',
    height: '40vh',
  }
  const tabs = props.tabs
  return (
    <div style={containerStyle}>
      {tabs.map((tab, i) => (
        <Tab key={i} idx={i + 1} />
      ))}
      <div className="container border my-5 bg-light">
        <p>{content}</p>
      </div>
    </div>
  )
}

export default Container
